import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
  font-size: 24px;
  font-weight: 700;
  margin-bottom: 25px;
  color: #fec107;
  text-align: center;
`

const Packagetype = styled.div`
  color: #757575;
  font-size: 18px;
  padding: 10px 0;
`

const Watchnum = styled.div`
  font-size: 18px;
  font-weight: bold;
  padding: 10px 0;
`

const Marketprice = styled.div`
  color: #d5dbd9;
  font-size: 18px;
  font-weight: bold;
  padding: 10px 0;
  text-decoration: line-through;
`

const Realprice = styled.div`
  font-size: 18px;
  font-weight: bold;
  padding: 10px 0;
`

const Desc = styled.div`
  font-size: 15px;
  font-weight: light;
  padding: 10px 0;
`

const Header = (props) => {
  const {market_price, package_type, period, real_price, title, discount, desc, watch_num} = props.attributes

  return (
    <Wrapper>
      <h1>{title}</h1>
      <div>
        <Desc>{desc}</Desc>
        <Marketprice>市价：{market_price} 元</Marketprice>
        <Realprice>现价：{real_price} 元</Realprice>
      </div>
    </Wrapper>
  )
}

export default Header
